import React from "react";
import './style.css';

function Search() {
  return (
    <div className="bg-secondary">
      <h3>Book Search</h3><br></br>

      <form>
      <h5>Book</h5>
        <input 
              type="text" 
              value={this.state.searchBar}
              onChange={this.handleInputChange}
              name="searchBar"
              placeholder="Book Title" />
        <button>Search</button>
      </form>
    </div>
  );
}

export default Search;
